import React from 'react';
import Navbar from '../components/navbar/Navbar';
import Featured from '../components/featured/Featured';
import './home.scss';


const Home = () => {
    return (
        <div className='home'>
            <Navbar />
            <img width='100%' src='https://st.depositphotos.com/2274151/2584/i/600/depositphotos_25849597-stock-photo-import-stamp.jpg' alt='' />
            <Featured />
        </div>
    )
}

export default Home;
